import React from 'react';
import Avatar from './Avatar';

const AvatarList = props => {
  const usersList = props.avatars.map(({ description, id, urls }) => {
    return <img alt={description} key={id} src={urls.regular} />;
  });

  return <div>{usersList}</div>;
};



